// Import the React and ReactDOM libraries 
import ReactDOM from 'react-dom';
import { NavLink, HashRouter } from 'react-router-dom';
import './style.scss';
import React, { Component } from 'react';
import AboutUs from './aboutUs';
import Footer from './footer';
import Navigation from './navBar';
import House from './houses';
import Investments from './investments';
import Button from './buttons';

class App extends Component {
  render(){
    return(
      <>
        <HashRouter>
          <h1>Hello</h1>
          <div>
            <HashRouter>
            <Navigation>
              <NavLink exact to="/about" component={AboutUs}></NavLink>
              <NavLink path to="/house" component={House} exact></NavLink>
              <NavLink path to="/investments" component={Investments}></NavLink>
              <NavLink path to="/house" component={House}></NavLink>
            </Navigation>
            </HashRouter>
          </div>
          <img src="../assets/house.jpg" alt="house"></img> 
          <Button />
          <Footer />
        </HashRouter>
      </>
      )
    }
  }

  // Take the react component and show it on the screen 
  ReactDOM.render(
      <App />, 
    document.querySelector('#root')
    );


